import React, { Component } from "react";
class Dashboard extends Component {
  state = {};
  render() {
    return (
      <div>
        <h1>Dashboard</h1>
        <ul>
          <li>Han</li>
          <li>OO yar</li>
        </ul>
      </div>
    );
  }
}

export default Dashboard;
